import React, { useState } from "react";
import {
  TextField,
  Grid,
  Box,
  Divider,
  InputLabel,
  MenuItem,
  FormControl,
  Select,
  Autocomplete,
  Button,
  Typography,
  IconButton,
} from "@mui/material";
import CloseIcon from "@mui/icons-material/Close";
import { LocalizationProvider, DatePicker } from "@mui/x-date-pickers";
import { AdapterDayjs } from "@mui/x-date-pickers/AdapterDayjs";
import "../../styles/LandingPage.scss";
import { useNavigate } from "react-router-dom"; // Import useNavigate

function AuctionCar() {
  const [minimumPrice, setMinimumPrice] = useState("");
  const [bidIncrement, setBidIncrement] = useState("");
  const [modelYear, setModelYear] = useState("");
  const [selectedMake, setSelectedMake] = useState("");
  const [selectedModel, setSelectedModel] = useState("");
  const [transmission, setTransmission] = useState("");
  const [fuelType, setFuelType] = useState("");
  const [mileAge, setMileAge] = useState("");
  const [postalCode, setPostalCode] = useState("");
  const [description, setDescription] = useState("");
  const [errors, setErrors] = useState({});
  const [startDate, setStartDate] = useState(null);
  const [endDate, setEndDate] = useState(null);
  const [images, setImages] = useState([]);
  const [imagePreviews, setImagePreviews] = useState([]);
  const [uploadError, setUploadError] = useState("");
  const maxPhotos = 20;
  const navigate = useNavigate(); // Initialize navigate

  const makes = {
    MiniCooper: ["Clubmann", "Countrymann", "Cooper S", "3 Doors", "5 Doors"],
    BMW: ["BMW i3", "BMW i4", "BMW i5", "BMW i6", "BMW i7", "BMW i8"],
    MercedesBenz: ["GLC", "GLA", "GLE", "GLS"],
  };

  const postalCodes = [
    "80331 Munchen",
    "85748 Garching Bei Munchen",
    "86836 Klosterlechfeld",
    "85716 Unterschleissheim",
  ];

  const validate = () => {
    const errors = {};
    if (!minimumPrice.trim()) {
      errors.minimumPrice = "This field is required";
    }
    if (!bidIncrement.trim()) {
      errors.bidIncrement = "This field is required";
    } else if (isNaN(bidIncrement) || Number(bidIncrement) <= 0) {
      errors.bidIncrement = "Bid increment must be a positive number";
    }
    if (!mileAge.trim()) {
      errors.mileAge = "This field is required";
    } else if (isNaN(mileAge) || Number(mileAge) <= 0) {
      errors.mileAge = "Mile age must be a positive number";
    }
    return errors;
  };

  const handleBlur = (event) => {
    const { name } = event.target;
    const fieldErrors = validate();
    setErrors({ ...errors, [name]: fieldErrors[name] });
  };

  const handleMakeChange = (event) => {
    setSelectedMake(event.target.value);
    setSelectedModel(""); // Reset the second dropdown when the first changes
  };

  const handleModelChange = (event) => {
    setSelectedModel(event.target.value);
  };

  const handleTransmissionChange = (event) => {
    setTransmission(event.target.value);
  };

  const handleFuelTypeChange = (event) => {
    setFuelType(event.target.value);
  };

  const handlePostalCodeChange = (event, newValue) => {
    setPostalCode(newValue);
  };

  const handleDescriptionChange = (event) => {
    setDescription(event.target.value);
  };

  const handleFileUpload = (event) => {
    const files = Array.from(event.target.files);
    const newTotal = images.length + files.length;

    if (newTotal > maxPhotos) {
      setUploadError(`You can only upload a maximum of ${maxPhotos} photos.`);
    } else {
      const newImages = [...images, ...files];
      setImages(newImages);

      const newPreviews = files.map((file) => URL.createObjectURL(file));
      setImagePreviews((prevPreviews) => [...prevPreviews, ...newPreviews]);
      setUploadError("");
      console.log();
    }
  };

  const handleRemoveImage = (index) => {
    setImages((prevImages) => {
      const newImages = [...prevImages];
      newImages.splice(index, 1);
      return newImages;
    });

    setImagePreviews((prevPreviews) => {
      const newPreviews = [...prevPreviews];
      newPreviews.splice(index, 1);
      return newPreviews;
    });
  };

  const handleSubmit = async (event) => {
    event.preventDefault();
    const formData = new FormData();

    images.forEach((image) => {
      formData.append("images", image);
    });

    formData.append("minimumPrice", minimumPrice);
    formData.append("bidIncrement", bidIncrement);
    formData.append("startDate", startDate ? startDate.toISOString() : "");
    formData.append("endDate", endDate ? endDate.toISOString() : "");
    formData.append("make", selectedMake);
    formData.append("model", selectedModel);
    formData.append("modelYear", modelYear);
    formData.append("transmission", transmission);
    formData.append("fuelType", fuelType);
    formData.append("mileAge", mileAge);
    formData.append("postalCode", postalCode);
    formData.append("description", description);


      alert("Car and auction created successfully!");
      navigate("/myauctions"); // Redirect to myauctionspage

  };

  return (
    <div>
      <div className="pageHeading">Auction A Car</div>
      <Box
        component="form"
        className="auctionACarContainer"
        sx={{ padding: "20px 40px", maxWidth: "100%" }}
        onSubmit={handleSubmit}
        noValidate
      >
        <div className="sectionHeading"> About Event </div>

        <Grid container spacing={3} className="aboutEventContainer">
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutEventField">
              <TextField
                label="Minimum Price"
                name="minimumPrice"
                value={minimumPrice}
                onBlur={handleBlur}
                onChange={(e) => setMinimumPrice(e.target.value)}
                error={!!errors.minimumPrice}
                helperText={errors.minimumPrice}
                fullWidth
                type="number"
              />
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutEventField">
              <TextField
                label="Bid increment"
                name="bidIncrement"
                value={bidIncrement}
                onBlur={handleBlur}
                onChange={(e) => setBidIncrement(e.target.value)}
                error={!!errors.bidIncrement}
                helperText={errors.bidIncrement}
                fullWidth
                type="number"
              />
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutEventField">
              <LocalizationProvider dateAdapter={AdapterDayjs}>
                <DatePicker
                  label="Start Date"
                  value={startDate}
                  onChange={(newValue) => setStartDate(newValue)}
                  renderInput={(params) => <TextField {...params} fullWidth />}
                />
              </LocalizationProvider>
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutEventField">
              <LocalizationProvider dateAdapter={AdapterDayjs}>
                <DatePicker
                  label="End Date"
                  value={endDate}
                  onChange={(newValue) => setEndDate(newValue)}
                  renderInput={(params) => <TextField {...params} fullWidth />}
                />
              </LocalizationProvider>
            </div>
          </Grid>
        </Grid>
        <Divider style={{ width: "100%", margin: "20px 0" }} />
        <div className="sectionHeading">About Car</div>
        <Grid container spacing={3} className="aboutCarContainer">
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutCarField">
              <FormControl fullWidth>
                <InputLabel>Make</InputLabel>
                <Select
                  value={selectedMake}
                  onChange={handleMakeChange}
                  label="Make"
                >
                  {Object.keys(makes).map((make) => (
                    <MenuItem key={make} value={make}>
                      {make}
                    </MenuItem>
                  ))}
                </Select>
              </FormControl>
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutCarField">
              <FormControl fullWidth>
                <InputLabel>Model</InputLabel>
                <Select
                  value={selectedModel}
                  onChange={handleModelChange}
                  label="Model"
                  disabled={!selectedMake}
                >
                  {selectedMake &&
                    makes[selectedMake].map((model) => (
                      <MenuItem key={model} value={model}>
                        {model}
                      </MenuItem>
                    ))}
                </Select>
              </FormControl>
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutCarField">
              <TextField
                label="Model Year"
                name="modelYear"
                value={modelYear}
                onBlur={handleBlur}
                onChange={(e) => setModelYear(e.target.value)}
                error={!!errors.modelYear}
                helperText={errors.modelYear}
                fullWidth
                type="number"
              />
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutCarField">
              <FormControl fullWidth>
                <InputLabel>Transmission</InputLabel>
                <Select
                  value={transmission}
                  onChange={handleTransmissionChange}
                  label="Transmission"
                >
                  <MenuItem value="Automatic">Automatic</MenuItem>
                  <MenuItem value="Manual">Manual</MenuItem>
                </Select>
              </FormControl>
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutCarField">
              <FormControl fullWidth>
                <InputLabel>Fuel Type</InputLabel>
                <Select
                  value={fuelType}
                  onChange={handleFuelTypeChange}
                  label="Fuel Type"
                >
                  <MenuItem value="Petrol">Petrol</MenuItem>
                  <MenuItem value="Diesel">Diesel</MenuItem>
                  <MenuItem value="Electric">Electric</MenuItem>
                  <MenuItem value="Hybrid">Hybrid</MenuItem>
                </Select>
              </FormControl>
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutCarField">
              <TextField
                label="Mile Age"
                name="mileAge"
                value={mileAge}
                onBlur={handleBlur}
                onChange={(e) => setMileAge(e.target.value)}
                error={!!errors.mileAge}
                helperText={errors.mileAge}
                fullWidth
                type="number"
              />
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <div className="aboutCarField">
              <Autocomplete
                options={postalCodes}
                value={postalCode}
                onChange={handlePostalCodeChange}
                renderInput={(params) => (
                  <TextField {...params} label="Postal Code" />
                )}
              />
            </div>
          </Grid>
          <Grid item xs={12} sm={6} md={8} lg={6}>
            <div className="aboutCarField">
              <TextField
                label="Description"
                name="description"
                value={description}
                onBlur={handleBlur}
                onChange={handleDescriptionChange}
                fullWidth
                multiline
                rows={4}
              />
            </div>
          </Grid>
        </Grid>
        <div className="imagePreviewContainer">
          <Grid item xs={12} sm={6} md={4} lg={3}>
            <input
              accept="image/*"
              style={{ display: "none" }}
              id="raised-button-file"
              multiple
              type="file"
              onChange={handleFileUpload}
            />
            <label htmlFor="raised-button-file">
              <Button
                variant="contained"
                component="span"
                fullWidth
                className="secondaryButton"
              >
                Upload Photos
              </Button>
            </label>
          </Grid>

          {imagePreviews.map((preview, index) => (
            <div className="imagePreviewItem" key={index}>
              <img
                src={preview}
                alt={`Preview ${index}`}
                className="imagePreview"
              />
              <IconButton
                onClick={() => handleRemoveImage(index)}
                className="removeIcon"
              >
                <CloseIcon />
              </IconButton>
            </div>
          ))}
          {uploadError && <Typography color="error">{uploadError}</Typography>}
        </div>
        <div className="aboutEventContainer">
          <Button
            type="submit"
            variant="contained"
            color="primary"
            className="secondaryButton"
          >
            Submit
          </Button>
        </div>
      </Box>
    </div>
  );
}

export default AuctionCar;
